import React from 'react';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';


export const Continents = ({ continents, regions, onClick }) => {
    return (
        <div>
            <Navbar bg="dark" variant="dark">
                <Navbar.Brand>Continents</Navbar.Brand>
                <Nav className="mr-auto">
                    {continents.map(cont =>
                        <NavDropdown title={cont} id="{cont}-dropdown">
                            {regions.map(reg =>
                                <NavDropdown.Item eventKey={reg} onClick={(e) => onClick(cont, reg)}>{reg}</NavDropdown.Item>)}
                        </NavDropdown>)}
                </Nav>
            </Navbar>
        </div>
    )
}
